import unittest
from python_code import *

class Tests(unittest.TestCase):

    def test_only_dna(self):
        self.assertFalse(PCRSimulator.only_dna('kdjfaslkdnfowpfn'))
        self.assertTrue(PCRSimulator.only_dna('actgctgctagca'))

    def test_only_dna_or_degen(self):
        self.assertTrue(PCRSimulator.only_dna_or_degen('atcgvnkbd'))
        self.assertFalse(PCRSimulator.only_dna_or_degen('atcgvnkbdz'))

    def test_rev_comp_calc(self):
        result = PCRSimulator.rev_comp_calc('actgcatcgctc')
        self.assertEqual('gagcgatgcagt', result)

    def test_find_anneal_reg_for(self):
        result = PCRSimulator.find_anneal_reg_for('atcgatcg', 'atcgatcggctagctga')
        self.assertEqual([0, 'atcgatcg'], result)

        result = PCRSimulator.find_anneal_reg_for('atcgatcg', 'gtcatcgatcg')
        self.assertEqual([3, 'atcgatcg'], result)

        result = PCRSimulator.find_anneal_reg_for('agtcaGGTCTCataatGCCACGTATCGCCAGATGTT'.lower(),''''''.lower())
        self.assertEqual([862, 'GCCACGTATCGCCAGATGTT'.lower()], result)

    def test_find_anneal_reg_rev(self):
        result = PCRSimulator.find_anneal_reg_rev('ccagtggtctcagactgatcctgcgtgaacgtcatg', ''.lower())
        self.assertEqual([5641, 'gactgatcctgcgtgaacgtcatg'], result)

    def test_circularize(self):
        self.assertEqual('atcctgcgtgaacgtcatggactg', PCRSimulator.circularize('gactgatcctgcgtgaacgtcatg', 5))

    def test_pcr_simulator(self):
        result = PCRSimulator('agtcaGGTCTCataatGCCACGTATCGCCAGATGTT', 'ccagtggtctcAgactgatcctgcgtgaacgtcatg', '')
        self.assertEqual(result.pcr_simulator(), ''.lower())

        result = PCRSimulator('agtcaGGTCTCkknnkGCCACGTATCGCCAGATGTT', 'kknnkggtctcAgactgatcctgcgtgaacgtcatg', '')
        self.assertEqual(result.pcr_simulator(), ''.lower())
